import React from 'react';
import "../SignIn.css"
import FacebookLogin from 'react-facebook-login';
import FacebookRoundedIcon from '@mui/icons-material/FacebookRounded';

const responseFacebook = (response) => {
    console.log(response);
    // You can add your own logic here to handle the Facebook login response
};

const FacebookAuthButton = () => {
    return (
        <FacebookLogin
            appId='3373040909602735'
            autoLoad={false}
            fields="name,email,picture"
            textButton=''
            cssClass="oAuth-button"
            callback={responseFacebook}
            icon={<FacebookRoundedIcon className="facebook-icon" sx={{ color: '#3b5998', fontSize: 80, verticalAlign: 'middle', margin: '0px' }} />}
        />
    );
};

const GoogleAuthButton = (props) => {
    return (
        <button className="secondary-button" onClick={props.onClick}>
            {props.label}
        </button>
    );
};

const AppleAuthGroup = (props) => {
    return (
        <div className="button-group">
            {props.children}
        </div>
    );
};

export { FacebookAuthButton, GoogleAuthButton, AppleAuthGroup };
